import { Component, Vue, Prop } from 'vue-property-decorator';

@Component({
  model: {
    prop: 'value',
    event: 'change',
  },
})
export default class Input extends Vue {
  @Prop() private value!: number;
  @Prop() private name!: string;

  @Prop() private fullwidth!: string;
}
